import React from 'react';
import { Anchor } from 'antd';
const { Link } = Anchor;

function NavIcon ({titleIcon, iconStyle, NavTabText, NavTabStyle, href}) {
    
    
    
    return (
        <div>
            <li style={iconStyle}>
                <p style={NavTabStyle}>
                    <a style={NavTabText} className="NavTab__button-text">{titleIcon}</a>
                </p>
                <Anchor>
                        <Link href={href} />
                    </Anchor>
            </li>
            
        </div>
        
    );
}

export default NavIcon;
